        Bag = 5
    }

    [Table("inventory")]
    public class Inventory
    {
        [Key]
        [Column("id")]
        public int Id { get; set; }
        public InventoryType Type { get; set; }
        public string Name { get; set; }
        public string Value { get; set; }
        public int Quantity { get; set; }
        public int OwnerId { get; set; }
        public InventoryOwnerType OwnerType { get; set; }
        public double DroppedX { get; set; }
        public double DroppedY { get; set; }
        public double DroppedZ { get; set; }
        public double DroppedRX { get; set; }
        public double DroppedRY { get; set; }
        public double DroppedRZ { get; set; }
        public int DroppedDimension { get; set; }
        public int SlotPosition { get; set; }
        [NotMapped]
        public int[] SlotSpan { get { return GetInventorySlotSpan[Type]; } }
        [NotMapped]
        public string Image { get { return GetInventoryImage[Type]; } }
        [NotMapped]
        public string SlotPosStr { get { return SlotPosition.ToString(); } }

        [NotMapped]
        public string OwnerName { get
        {
            return Type == InventoryType.BankCard
                ? PlayerRepository.GetPlayerDataById(BankRepository.GetAccountByCardNumber(long.Parse(Value))
                    .RegisterOwnerId).Username.Roleplay()
                : "";
        } }
        [NotMapped]
        public int OwnerGender { get { return 0; } }

        [NotMapped]
        public Vector3 DroppedPos
        {
            get { return new Vector3(DroppedX, DroppedY, DroppedZ); }
            set { DroppedX = value.X; DroppedY = value.Y; DroppedZ = value.Z; }
        }

        [NotMapped]
        public Vector3 DroppedRot
        {
            get { return new Vector3(DroppedRX, DroppedRY, DroppedRZ); }
            set { DroppedRX = value.X; DroppedRY = value.Y; DroppedRZ = value.Z; }
        }

        [NotMapped]
        public NetHandle DroppedObj { get; set; }

        public static Inventory CreateCashInventoryItem(long amount)
        {
            if (amount <= 0 || amount >= 150001) return null;
            Inventory inv = new Inventory()
            {
                OwnerId = -1,
                Value = amount.ToString(),
                Quantity = 1,
                Name = "Cash"
            };

            if (amount <= 1000) inv.Type = InventoryType.CashSmall;
            else if (amount <= 10000) inv.Type = InventoryType.CashMedium;
            else if (amount <= 50000) inv.Type = InventoryType.CashLarge;
            else if (amount <= 150000) inv.Type = InventoryType.CashHuge;
            return inv;
        }

