        public static bool IsStackable(Inventory item)
        {
            switch (item.Type)
            {
                case InventoryType.VehicleKey:
                case InventoryType.PropertyKey:
                case InventoryType.BankCard:
                case InventoryType.Fish:
                case InventoryType.SmartPhone1:
                case InventoryType.SmartPhone2:
                case InventoryType.SmartPhone3:
                case InventoryType.SmartPhone4:
                case InventoryType.SmartPhone5:
                case InventoryType.SimCard:
                case InventoryType.Alarm:
                case InventoryType.Safe:
                case InventoryType.Till:
                case InventoryType.EMSRadio:
                case InventoryType.CBRadio:
                case InventoryType.Cuffs:
                case InventoryType.AmmunitionNineMM:
                case InventoryType.AmmunitionShell:
                case InventoryType.AmmunitionSevenSixTwo:
                case InventoryType.AmmunitionFiveFiveSix:
                case InventoryType.Ammunition10mm:
                case InventoryType.DriversLicense:
                case InventoryType.CashSmall:
                case InventoryType.CashMedium:
                case InventoryType.CashLarge:
                    return false;
                default:
                    return true;
            }
        }
